import React from "react";

const Greet = () => `Hi! This page is still being built. +
"I have to work/study/take care of the house/workout/meal" +
"plan so pls be [very] patient 	╰( ͡° ͜ʖ ͡° )つ──☆*:・ﾟ`

export default Greet;
